import React from "react";

// Core Components
import NavBar from "./modules/NavBar";

function App() {
    return (
        <>
            <div
                className="App"
                style={{ flexgrow: 1, backgroundColor: "#3D3D3D" }}
            >
                {/* Navigation Bar */}
                <NavBar />
            </div>
        </>
    );
}

export default App;
